description_second:
Комплект для уборки AVIK - это идеальный вариант для поддержания чистоты, особенно в помещениях с большой площадью. 

Преимущества комплекта:
1. Телескопическая ручка: можно подобрать длину, убрав или добавив один из сегментов. Максимальная длина - 145 см.;
2. Регулируемый угол наклона - от 45 до 180°. Высота швабры в горизонтальном положении - 10 см.;
3. Микрофибровая насадка: эффективно очищает загрязнения, хорошо впитывает и удерживает влагу. Насадку легко установить и снять. Допустима стирка в стиральной машине;
4. Подходит для разных видов напольного покрытия. Не оставляет разводов;
5. Качество: комплект выполнен из прочного и толстого пластика, стержни швабры/центрифуга и другие составные элементы изготовлены из нержавеющей стали (марка стали AISI 304). Рекомендуем не использовать абразивные (а именно хлоросодержащие) вещества, т.к. это может привести к появлению ржавчины;
6. Удобное ведро: не перевешивает, хорошо держит баланс при переноске. Ведро состоит из двух неизолированных отсеков (для отжима и полоскания);
7. Автоматический (центрифужный) отжим и полоскание: комплект позволит сохранить руки в чистоте, а маникюр всегда будет опрятный. Степень отжима можно регулировать самостоятельно (для эффективного отжима уровень воды в ведре должен быть ниже уровня центрифуги). Общий объём ведра - 10 литров, для мытья полов достаточно около 6-7 литров воды;
8. Комплектуется дозатором, позволяющим экономно расходовать моющее средство.

Внимание: швабра не предназначена для сбора мусора/волос/шерсти (желательно использовать после сухой уборки).

Для продления срока службы комплекта: пожалуйста, соблюдайте правила эксплуатации (особенно важно при отжиме и полоскании своевременно менять положение переключателя на "on", а также не извлекать резко швабру из центрифуги в момент её сильного раскручивания). В разделе "фото" имеются рекомендации по сборке и эксплуатации швабры, в комплекте с товаром идёт бумажная инструкция.

Артикул сменных насадок: 50825428
